import React, { Component } from 'react'

export default class FetchAPI extends Component {
    constructor(){
        super()
        this.state={
            userName:null
        } 
    }
    componentDidMount(){
        fetch('').then((res)=>{
            res.json((result)=>{
                this.setState({userName:result})
                console.log(result)
            })
        })
    }
    render() {
        return (
            <div>{
                this.state.userName
            }

            </div>
        )
    }
}
